using MultiPrecision;
using System;
using System.Linq;

namespace OwensT {
    public static class ExpectedN8 {
        static readonly (MultiPrecision<Pow2.N8> x, MultiPrecision<Pow2.N8> w)[] gls;

        static ExpectedN8() {
            gls = p127.Select((v) => ((MultiPrecision<Pow2.N8>)v.x, (MultiPrecision<Pow2.N8>)v.w)).ToArray();
        }

        public static MultiPrecision<Pow2.N8> Value(MultiPrecision<Pow2.N8> h, MultiPrecision<Pow2.N8> a) {
            if (a <= 4 || h >= 4) {
                return GaussQuadrature(h, a);
            }

            if (h * a <= 32) { // erf(h * a / sqrt(2)) < 1
                MultiPrecision<Pow2.N8> c = OneMinusErfErf<Pow2.N8, Plus8<Pow2.N8>>.Value(h / MultiPrecision<Pow2.N8>.Sqrt2, h * a / MultiPrecision<Pow2.N8>.Sqrt2) / 4;

                MultiPrecision<Pow2.N8> t = GaussQuadrature(h * a, 1 / a);

                if (c < t * 2) {
                    throw new ArithmeticException($"digit loss {h}, {a}");
                }

                MultiPrecision<Pow2.N8> y = c - t;

                return y;
            }
            else {
                MultiPrecision<Pow2.N8> y = MultiPrecision<Pow2.N8>.Erfc(h / MultiPrecision<Pow2.N8>.Sqrt2) / 4;

                return y;
            }
        }

        public static MultiPrecision<Pow2.N8> GaussQuadrature(MultiPrecision<Pow2.N8> h, MultiPrecision<Pow2.N8> a) {
            MultiPrecision<Pow2.N8> h2 = h * h, n_half_h2 = -h2 / 2;

            MultiPrecision<Pow2.N8> ig = MultiPrecision<Pow2.N8>.Sqrt(MultiPrecision<Pow2.N8>.PI / 2) / h
                * MultiPrecision<Pow2.N8>.Exp(n_half_h2) * MultiPrecision<Pow2.N8>.Erf(h * a / MultiPrecision<Pow2.N8>.Sqrt2);

            MultiPrecision<Pow2.N8> x_peak = MultiPrecision<Pow2.N8>.Sqrt(MultiPrecision<Pow2.N8>.Sqrt(h2 + 8) / (2 * h) - MultiPrecision<Pow2.N8>.Point5);
            MultiPrecision<Pow2.N8> ap = MultiPrecision<Pow2.N8>.Min(a, x_peak * 2);
            MultiPrecision<Pow2.N8> ad = MultiPrecision<Pow2.N8>.Min(a, x_peak * 13.5) - ap;

            MultiPrecision<Pow2.N8> sp = 0, sd = 0;

            for (int k = 0; k < gls.Length; k++) {
                (MultiPrecision<Pow2.N8> x, MultiPrecision<Pow2.N8> w) = gls[k];
                MultiPrecision<Pow2.N8> x_sft = x * ap;

                MultiPrecision<Pow2.N8> p = x_sft * x_sft;
                MultiPrecision<Pow2.N8> r = 1 + p;

                MultiPrecision<Pow2.N8> u = w * MultiPrecision<Pow2.N8>.Exp(n_half_h2 * r) * p / r;

                sp += u;
            }

            if (ad > 0) {
                for (int k = 0; k < gls.Length; k++) {
                    (MultiPrecision<Pow2.N8> x, MultiPrecision<Pow2.N8> w) = gls[k];
                    MultiPrecision<Pow2.N8> x_sft = x * ad + ap;

                    MultiPrecision<Pow2.N8> p = x_sft * x_sft;
                    MultiPrecision<Pow2.N8> r = 1 + p;

                    MultiPrecision<Pow2.N8> u = w * MultiPrecision<Pow2.N8>.Exp(n_half_h2 * r) * p / r;

                    sd += u;
                }
            }

            MultiPrecision<Pow2.N8> y = (ig - sp * ap - sd * ad) / (2 * MultiPrecision<Pow2.N8>.PI);

            return y;
        }

